import React from "react";
import logo from "../src/images/IMG_20210329_205312_237.jpg";
import YouTubeIcon from '@material-ui/icons/YouTube';
import Typewriter from "typewriter-effect";
import '../node_modules/font-awesome/css/font-awesome.min.css';
import 'font-awesome/css/font-awesome.min.css';
import './Gallery.css'

const Gallery = () => {
  return (
    <>
      <section className="back-img">
        <div className=" gallery-img">



            <div className="text1  justify-center container6 align-items">
            <strong className="flex">Hey User! &nbsp; 
                    <Typewriter
                    options={{
                        autoStart:true,
                        loop:true,
                        delay:20,
                        deleteSpeed: 5,
                        strings: ['Welcome to Code with Sahil.', 'This is a Gallery Section.', 'Find Your Best design Here.', '3D styles and more...', 'Thank You So Much For Visiting Our Website.'],                    }}/>
               </strong>

            <p>
              Here you get all awesome features to implement in you websites.So
              don't confuse where to start and when to start.
            </p>
            <p>
              {" "}
              we provide you the best youtube free channels to learn full course
              of Web development, Python ,java and many much more...
            </p>


            </div>
            <div className="flex btn-tr justify-center text-center align-items">
                <button className="btn-bg10 "><i className="fas fa-youtube "></i>no spinner but why</button>
            </div>

        </div>
    </section>
    </>
  );
};
export default Gallery;
